import axios from "axios";

const instance = axios.create({
  baseURL: 'http://localhost:8080/api',
  // Uncomment the line below if you want to use the cloud function URL instead
  // baseURL: 'http://127.0.0.1:5001/clone-b74be/us-central1/api',
  headers: {
    'Content-Type': 'application/json',
  },
});

export default instance;
